import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './home'; // Corrected case
import Login from './Login';
import Signup from './Signup';
import Arena from './arena';
import Time_table from './timetable';
import Navbar from './components/common/Navbar';
function App() {
    return (
        <Router>
            <Navbar/>
            
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/signup" element={<Signup />} />
                <Route path="/arena" element={<Arena />} />
                <Route path="/timetable" element={<Time_table/>}/>
                <PrivateRoute path="/dashboard" component={Dashboard} />
                <PrivateRoute path="/courses" component={CourseList} />
                <PrivateRoute path="/courses/:id" component={CourseDetail} />
                <PrivateRoute path="/profile" component={Profile} />
                <PrivateRoute path="/achievements" component={AchievementList} />
            
        </Router>
    );
}

export default App;
